import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import add from './images/add.png';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup,
  Carousel, CloseButton, DropdownButton, Dropdown, Figure, Row, Col,
  Placeholder, ProgressBar, Spinner, Table, Tabs, Tab, Toast, ToastContainer,
  Collapse
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';
import ModalReact from './Modal/Modal';

function App() {
  const [open, setOpen] = useState(false);
  return (
    <div className="App">
      <Button
        onClick={() => setOpen(!open)}
        aria-controls="example-collapse-text"
        aria-expanded={open}
      >
        click
      </Button>
      <Collapse in={open} dimention="width">
        <div id="example-collapse-text">
          Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus
          terry richardson ad squid. Nihil anim keffiyeh helvetica, craft beer
          labore wes anderson cred nesciunt sapiente ea proident.
        </div>
      </Collapse>
    </div>
  )
}

export default App;
